INSERT INTO `tp_about` (`id`,`title`,`editorValue`,`create_time`,`update_time`,`delete_time`,`isdelete`,`status`) VALUES ('1','Company Profile','&lt;p style=&quot;text-indent: 2em;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp; &amp;nbsp;Hebei Xin Power New Energy Technology Co., Ltd. was established in Baoding, Hebei Province, with a capital injection of 30 million. It specializes in the research, development, design, production and sales of lithium battery packs. It is a professional lithium battery system solution and product provider in China.&lt;/span&gt;&lt;br/&gt;&lt;br/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Our company has strong technical strength, leading production technology, sophisticated production equipment, advanced testing equipment, and perfect testing methods. The ability to independently research and develop and produce lithium battery products is at the leading position in China. Based on the business philosophy of &ldquo;honesty, truth-seeking, research and development, and innovation&rdquo;, our company provides customers with reasonable production management mechanism, perfect hardware infrastructure, professional technical research and development team and perfect after-sales service guarantee. High quality, high standard and high level products.&lt;/span&gt;&lt;br/&gt;&lt;br/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Our company has always adhered to scientific and technological innovation, attaches importance to the development of independent intellectual property rights, strictly implements ISO standards in all aspects, and cooperates with key universities such as Hebei University to complete the integration of funds and technology. Hebei Xin Power New Energy Technology Co., Ltd. specializes in the production of energy storage battery packs and power battery packs, which are widely used in small solar power stations, UPS reserve power supplies, electric vehicles and other fields. Products with high capacity, high safety, high consistency, long cycle life and other advantages by the majority of customers.&lt;/span&gt;&lt;br/&gt;&lt;br/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;The high-end brand of the tree strives to be the top of the industry and will make Xin Power a world-renowned enterprise. On the way forward, Xin Power will unswervingly carry out the sacred mission of &ldquo;letting the world shine&rdquo; with practical actions.&lt;/span&gt;&lt;/p&gt;','1572250227','1572260097','0','0','1');
INSERT INTO `tp_aboutus` (`id`,`titles`,`img`,`editorValue`,`create_time`,`update_time`,`delete_time`,`isdelete`,`status`) VALUES ('1','About US','/tmp/uploads/20191031\988fc668e2beb5f5ec3dc5595f348816.jpg','&lt;p&gt;　　Hebei Xin Power New Energy Technology Co., Ltd. was established in Baoding, Hebei Province, with a capital injection of 30 million. It specializes in the research, development, design, production and sales of lithium battery packs. It is a professional lithium battery system solution and product provider in China.&lt;br/&gt;Our company has strong technical force, leading production technology, excellent production equipment, advanced testing instruments, perfect testing means, and the ability to independently develop and produce lithium battery products is in the leading position in China. Our company is based on the business philosophy of &amp;quot;honesty, seeking truth from facts, being proficient in research and development, and being brave in innovation&amp;quot;, and adopts reasonable production management mechanism, perfect hardware infrastructure, professional technical research and development team, and perfect after-sales service guarantee to provide customers with high-quality, high standard and high-level products.&lt;/p&gt;','1572513827','1572514136','','0','1');
