INSERT INTO `tp_newsa` (`id`,`titles`,`name`,`img`,`editorValue`,`num`,`home`,`sort`,`title`,`description`,`keywords`,`create_time`,`update_time`,`delete_time`,`isdelete`,`status`) VALUES ('1','Company news','1What is AGV lithium battery?','','&lt;p class=&quot;NewText&quot; style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; text-indent: 2em; color: rgb(51, 51, 51); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;What is AGV lithium battery?&lt;/p&gt;&lt;p class=&quot;NewText&quot; style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; text-indent: 2em; color: rgb(51, 51, 51); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&amp;quot;AGV&amp;quot; in AGV lithium battery is the abbreviation of automated guided vehicle, which means &amp;quot;automatic guided transport vehicle&amp;quot;. AGV is a transport vehicle equipped with electromagnetic or optical automatic guidance devices, which can travel along the specified guidance path, with safety protection and various transfer functions.&lt;/p&gt;&lt;p class=&quot;NewText&quot; style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; text-indent: 2em; color: rgb(51, 51, 51); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;The &amp;quot;lithium battery&amp;quot; in AGV lithium battery is a kind of battery with lithium metal or lithium alloy as negative electrode material and non-aqueous electrolyte solution. In 1912, the lithium metal battery was first proposed and studied by Gilbert n. Lewis. In the 1970s, M. S. Whittingham proposed and began to study lithium-ion batteries. Because the chemical properties of lithium metal are very active, the processing, preservation and use of lithium metal have very high environmental requirements. With the development of science and technology, lithium battery has become the mainstream.&lt;/p&gt;&lt;p class=&quot;NewText&quot; style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; text-indent: 2em; color: rgb(51, 51, 51); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;AGV lithium battery can be roughly divided into two categories: lithium metal battery and lithium ion battery. Lithium ion batteries do not contain metallic lithium and can be charged. The fifth generation of rechargeable battery lithium metal battery was born in 1996. Its safety, specific capacity, self discharge rate and performance price ratio are better than lithium-ion battery. Limited by its own high-tech requirements, only a few companies in several countries are now producing the lithium metal battery.&lt;/p&gt;&lt;p class=&quot;NewText&quot; style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; text-indent: 2em; color: rgb(51, 51, 51); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;As an AGV lithium battery manufacturer, Hebei Xinli New Energy Technology Co., Ltd. has been engaged in the customization of AGV lithium battery for many years. We have cooperated with many well-known enterprises from scratch, relying on the excellent quality and satisfactory after-sales service. Xinli battery, welcome your consultation and customization.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;','0','1','1','Home','','aaa','1572317943','1572502983','','0','1');
